export const setSlectedCheckBoxList = (value) => ({
  type: "SET_SLECTEDCHECKBOXLIST",
  payload: value,
});

export const cleanSlectedCheckBoxList = (value) => ({
  type: "CLEAN_SLECTEDCHECKBOXLIST",
  payload: value,
});
